export function add12(a: number, b: number): number {
  return a + b;
}

export function subtract12(a: number, b: number): number {
  return a - b;
}

export function multiply12(a: number, b: number): number {
  return a * b;
}

export function divide12(a: number, b: number): number {
  return a / b;
}
